import React from "react";
import { Col, Row } from "react-bootstrap";
import "./Style.css";
import { FaFacebookSquare } from "react-icons/fa";
import { BsInstagram, BsTwitter, BsLinkedin, BsGithub } from "react-icons/bs";
import { SiGmail } from "react-icons/si";

const Footer = () => {
  return (
    <>
      <div>
        <Row className="bg-footer">
          {/* Column 1 */}
          <Col xs={1}></Col>
          <Col className="brand">
            <Row className="mt-5">
              <h1>Resume Maker</h1>
            </Row>
          </Col>
          {/* Column 2 */}
          <Col className="mt-5">
          <h2>Contact Us </h2>
          <h2 className="mt-5">About</h2>
          </Col>
          {/* Column 3 */}
          <Col className="mt-5 ml-3"> <h2>Blog</h2></Col>
          {/* Social Media Icon */}
          <Row className="social-media mb-5 mt-5">
              <Col></Col>
            <Col>
              <FaFacebookSquare />
            </Col>
            <Col>
              <BsInstagram />
            </Col>
            <Col>
              <BsTwitter />
            </Col>
            <Col>
              <BsLinkedin />
            </Col>
            <Col>
              <BsGithub />
            </Col>
            <Col>
              <SiGmail />
            </Col>
            <Col></Col>
          </Row>
        </Row>
      </div>
    </>
  );
};
export default Footer;
